const [data, setData] = useState();
  const [isLoad, setIsLoad] = useState(true);

  useEffect(() => {
    async function fetchData() {
      await callApi("get", "products", null)
        .then((res) => setData(res.data))
        .catch((err) => console.log(err));
      setIsLoad(false);
    }
    fetchData();
  }, []);
